import React, { Component } from "react";
import SendMessage from "./modals/SendMessage";
import CreateContact from "./modals/CreateContact";


export default class Contactos extends Component {
    render(){
        return(
        <div>
        <h1>Contactos</h1>
        <div className="m-3">
        <SendMessage/>
        </div>
        <div>
        <CreateContact/>
        </div>
        </div>
    )
    }
}
